function decompr(compress,dic)
    local text = ''
    local dic_todecompress = split(compress:sub(2),utf8.char(0))
	local i = 1
    while i < #dic_todecompress do
        text = text..[[\]]..dic[utf8.codepoint(dic_todecompress[i],1,1)-1]
        if dic_todecompress[i]:sub(2) ~= '' then
            for g = 1,tonumber(dic_todecompress[i]:sub(2)) do
                text = text..[[\]]..dic[utf8.codepoint(dic_todecompress[i],1,1)-1]
             end
        end
	end
	return text
end

function split(str, delim, plain)
    local tokens, pos, plain = {}, 1, not (plain == false) --[[ delimiter is plain text by default ]]
    repeat
        local npos, epos = string.find(str, delim, pos, plain)
        table.insert(tokens, string.sub(str, pos, npos and npos - 1))
        pos = epos and epos + 1
    until not pos
    return tokens
end

